import React from 'react'
import Card from '../components/Card';

const data = {
    "listings": [
      {
        "id": 56513315,
        "title": "Oceanside Villa",
        "owner": "alina@unsw.edu.au",
        "address": {},
        "thumbnail": "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg==",
        "price": 350,
        "reviews": [
          {}
        ]
      }
    ]
}

function LandingPage() {

    return (
        <div >

            <Card
                
                thunbnail="https://a0.muscache.com/im/pictures/a6b08861-feb8-4a01-a76d-b33d2867b441.jpg?im_w=480"
                title="Online Experiences"
                description="Unique activities we can do together
                , led by a world of hosts."
                price={350}
                revie
            />
        </div>
    )
}

export default LandingPage
